import React, { Component } from 'react'
import { withTranslation } from 'react-i18next';

export class Earnings extends Component {
    render() {
        const { t } = this.props;
        const Income = [
            {
                id: 1,
                title: "View Ads",
                content: "Content"
            }
        ]
        return (
            <div>
                <h2 className="text-primary section-title">{t('menu.earnings')}</h2>

                <div className="row">
                    {Income.map((item, idx) => (
                    <div key={idx} className="col-lg-3 col-md-4 col-sm-6">
                        <div className="card mb-4">
                            <div className="card-header"><h5>{item.title}</h5></div>
                            <div className="card-body">
                                <h1>{item.content}</h1>
                            </div>
                        </div>
                    </div>
                    ))}
                </div>
            </div>
        )
    }
}

export default withTranslation()(Earnings)
